import {
  Button,
  Container,
  Nav,
  Navbar,
  NavLink,
  Stack,
} from "react-bootstrap";

export const Header = () => {
  return (
    <Stack direction="horizontal" gap={2}>
      <NavLink>123</NavLink>
      <Button as="a" variant="primary">
        Button as link
      </Button>
      <Button as="a" variant="success">
        Button as link
      </Button>
    </Stack>
  );
};
